import React, { useEffect } from "react";
import { GlobalContext } from '../Components/utils/global.context';
import Card from '../Components/Card';

const Favs = () => {
  const { themeState } = React.useContext(GlobalContext);
  const { favs } = themeState;

  useEffect(() => {
    // Realiza cualquier l칩gica adicional si es necesario al cargar la p치gina de favoritos
  }, []);

  return (
    <div className={themeState.theme ? 'App' : 'dark'}>
      <h1>Dentistas Favoritos</h1>
      <div className="card-grid">
        {favs.length > 0 ? (
          favs.map((dentist) => (
            <Card 
            key={dentist.id} 
            id={dentist.id}
            name={dentist.name}
            username={dentist.username}
            />
          ))
        ) : (
          <p>No tienes dentistas destacados.</p>
        )}
      </div>
    </div>
  );
};

export default Favs;
